using MoM.Module.Interfaces;
using System.Collections.Generic;
using System.Linq;

namespace MoM.Module.Models.Seed
{
    public class CountrySeed
    {
        private IDataStorage Storage;

        public CountrySeed(IDataStorage storage)
        {
            Storage = storage;
        }

        public void Seed()
        {
            foreach(var country in CountryList)
            {
                var exists = Storage.GetRepository<ICountryRepository>().Fetch(x => x.ISO31661Alpha2 == country.ISO31661Alpha2).FirstOrDefault();
                if (exists != null)
                {
                    country.CountryId = exists.CountryId;
                    if (exists != country) //If the record from the seed list is different than whats in the database - then we update the record in the database
                        Storage.GetRepository<ICountryRepository>().Update(country);
                }
                else
                {
                    //the country is not present in the database så we add the country
                    Storage.GetRepository<ICountryRepository>().Create(country);
                }
            }
        }

